commits.content:
.desc {
  color: rgba(255, 255, 255, 0.8);
  font-weight: 300;
  font-size: 16px;
  padding: 16px 0;
}

.button {
  width: max-content;
  padding: 12px 32px;
  background: var(--primary);
  border-radius: 5px;
  font-weight: 600;
  font-size: 17px;
  transition: background 0.3s;

  &:hover {
    background: var(--primary-hover);
  }
}

.logo {
  margin-right: auto;
  z-index: 9999;
  display: flex;
  flex-direction: column;

  .logoHeading {
    font-size: 32px;
    font-family: "Raleway";
    font-weight: 400;

    span {
      color: var(--primary);
      font-weight: 800;
    }
  }

  .logoSubheading {
    transform: translateY(-12px);
    display: inline-block;
    font-size: 13px;
    font-weight: 200;

    span {
      color: var(--primary);
      font-weight: 800;
    }
  }
}

@media (max-width: 1280px) {
  .desc {
    font-size: 15px;
    padding: 8px 0;
  }

  .button {
    font-size: 13px;
  }
}
